import {NavLink} from "react-router-dom";

function Navbar(){
    return (
        <>
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <h1 style={{color : 'red'}}>Foodman</h1>
                <NavLink className="navbar-brand" to='/'>Home</NavLink>


            </nav>
        </>
    );

}

export default Navbar;
